import { Icon } from "@iconify/react";
import { Stack, Button, IconButton } from "@mui/material";
import axios from "axios";
const SocialAuth = () => {
  const handleGoogleLogin = async (googleResponse) => {
    try {
      const response = await axios.post("http://localhost:5000/auth/google", {
        access_token: googleResponse.accessToken,
      });

      // Handle the response as needed
      console.log(response.data);

    } catch (error) {
      console.error("Google login error:", error);
    }
  };

  const handleFacebookLogin = async (facebookResponse) => {
    try {
      const response = await axios.post("http://localhost:5000/auth/facebook", {
        access_token: facebookResponse.accessToken,
      });

      // Handle the response as needed
      console.log(response.data);

    } catch (error) {
      console.error("Facebook login error:", error);
    }
  };
  return (
    <>
      <Stack direction="row" spacing={2}>
        <IconButton           
          clientId="712167130732-1a7t44doq15u0dbb6nr7urrd8fm19c1a.apps.googleusercontent.com"
          buttonText="Login with Google"
          onSuccess={handleGoogleLogin}
          onFailure={handleGoogleLogin}
          cookiePolicy={'single_host_origin'}
          sx={{
            border: "2px solid #ccc",
            borderRadius: "5px",
            padding: "0.5675rem",
            flex: 1,
          }}
        >
          <Icon icon="eva:google-fill" color="#DF3E30" width={22} height={22} />
        </IconButton>
        <IconButton
        appId="326382263403550"
        autoLoad={false}
        fields="name,email,picture"
        callback={handleFacebookLogin}
          sx={{
            border: "2px solid #ccc",
            borderRadius: "5px",
            padding: "0.5675rem",
            flex: 1,
          }}
        >
          <Icon

            icon="eva:facebook-fill"
            color="#1877F2"
            width={22}
            height={22}
          />
        </IconButton>
        <IconButton
          sx={{
            border: "2px solid #ccc",
            borderRadius: "5px",
            padding: "0.5675rem",
            flex: 1,
          }}
        >
          <Icon
            icon="eva:twitter-fill"
            color="#1C9CEA"
            width={22}
            height={22}
          />
        </IconButton>
      </Stack>
    </>
  );
};

export default SocialAuth;
